script: |
  super -f text -I q3937.spq | sort > q3937.out

inputs:
  - name: q3937.spq
    data: |
      SELECT - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * - col2 * 24 - col0 BETWEEN NULL AND 57;
  - name: tab1

outputs:
  - name: q3937.out
    data: |
      -59
      -68
      -96
